import {Listaclienti} from '../../actions/authAutentications';
import React, { Component } from 'react';

import PropTypes from 'prop-types';
import { connect } from 'react-redux';

//componenti da react-bootstrap
import { Container, Col, Row } from 'react-bootstrap';

class AggiornaClienti extends React.Component {
  constructor(props) {
    super(props);
    this.state = {nome1: ''};

    this.cambioFiltri = this.cambioFiltri.bind(this);
    this.filtra = this.filtra.bind(this);
  }
 
  
 async componentDidMount() {
   await this.props.Listaclienti();
 }

viewCustomer(id){
console.log(id);

}

cambioFiltri(e){
  this.setState({nome1: e.target.nome1});
}
 filtra(e){
  e.preventDefault();
  this.setState({nome1: e.target.nome1});
}
 
  render() {
   const {user}=this.props.customerlist;
   const CL=(
<div className="container">
<div class="center">
 <table class="responsive-table">

 <thead>

<tr>

<th >Name</th>
<th >cognome</th>
<th >Email</th>

</tr>

 </thead>
 <tbody>
   {
    user.filteruser(user => user.name==="Gabriele").map((user)=>
    
    <tr key={user._id}>
      <td>{user.name}</td>
      <td>{user.cognome}</td>
      <td>{user.email}</td>
    </tr>
    
    )}

   
 </tbody>
 </table>
</div>
</div>

   )


    
	return(
    
    <Container style={{marginTop: '3rem', marginBottom: '3rem'}}>
      <div className="Form">
            <form onSubmit={this.filtra}>
              <Row>
                <Col sm={2}>
              <div className="form-group">
              <label htmlFor="name">Nome</label>
                <input
                  value={this.state.nome1} onChange={this.cambioFiltri}
                  id="name"
                  type="text"
                />
              </div>
              </Col>
              <Col sm={2}>
              <div className="form-group">
              <label htmlFor="cognome">Cognome</label>
                <input

                  id="cognome"
                  type="text"
                />
              </div>
              </Col>
              <Col sm={2}>
              <div className="form-group">
              <label htmlFor="email">Email</label>
                <input

                  id="email"
                  type="text"
                />
              </div>
              </Col>
              <Col sm={2}>
              <div className="form-group">
              <label htmlFor="numero">Numero di telefono</label>
                <input

                  id="numero"
                  type="text"
                />
              </div>
              </Col>
              <Col sm={2}>
              <div className="form-group">
              <label htmlFor="cf">Codice Fiscale</label>
                <input

                  id="cf"
                  type="text"
                />
              </div>
              </Col>
              <Col sm={2}>
              <div className="form-group">
              <button type="submit" value="Registrazione Log" className="btn btn-dark btn-lg btn-block">Cerca</button>
              </div>
              </Col>
             </Row>
            </form>
          </div>
          <div className="row">
    {
      user.length===0?'NO USERS or server is offline':CL
    }
    </div>
          </Container>

  );
  }
}

 
   



AggiornaClienti.propTypes = {
 Listaclienti:PropTypes.func.isRequired,
 auth:PropTypes.object.isRequired,
 errors:PropTypes.object.isRequired,
customerlist:PropTypes.object.isRequired,

};
const mapStateToProps = state => ({
  auth:state.auth,
  errors:state.errors,
  customerlist:state.customerlist
});
export default connect(mapStateToProps, 
 {Listaclienti})
  (AggiornaClienti);
